import React from 'react';

import Counter from './Counter'

const Wrap = styled.div`
    display: flex;
    flex-direction: row;
    background-color: red;
    flex: 1;
`

const CounterRow: React.FC = () => {

    return (<div  style={styles.row}>
        <Counter />
        <Counter />
        <Counter />
        <Counter />
        <Counter />
    </div>)
}

const styles = {
    row: {
        flexDirection: "row" as "row",
        backgroundColor: "red",
        flex: 1
    }
}

export default CounterRow
